Burma VJ: Reporting from a Closed Country

Sociopolitical Documentary hosted by Anders Oestergaard, published by Magic Hour in 2008 - English narration


Information
------------------------------

Using smuggled footage, this documentary tells the story of the 2007 protests in Burma by thousands of monks.

